  constants_da.put('keyboardHelp', '<div class="helpControls"><h2>Tastaturnavigation<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Pile taster<\/h3>Brug piletasterne til at bev\xE6ge dig p\xE5 tv\xE6rs af kortet i en bestemt h\xF8jde.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + piletaster<\/h3>Hold SHIFT tasten nede mens du presser piletasten for at \xE6ndre kameraetssynsvinkel.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Side op/side ned<\/h3>Brug <b>PG UP<\/b> eller <b>PG DN<\/b> tasterne for at \xE6ndre h\xF8jden af kameraet.<\/div><\/div>');
  constants_da.put('mapHelp', '<div class="helpControls"><h2>Kort navigation<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Pan konsol<\/h3>Pan Konsolen tillader dig at bev\xE6ge dig i en bestemt h\xF8jde. Klik og tr\xE6k for at flytte dig. Jo fjernere fra centeret du tr\xE6kker, des hurtigere vil du.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Kamera konsol<\/h3>Kamera Konsollen bev\xE6ger kun kameraets synsfelt. Klik og tr\xE6k for at \xE6ndrekameraets synsfelt. The farther you drag from the center, the faster you will change the view.<br />Double clicking with the left mouse button on the camera console resets the camera view to a North and down looking position.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Zoom knapper<\/h3>At klikke p\xE5 dem vil \xE6ndre kameraets h\xF8jde. Plusknappen vil bev\xE6ge kameraet t\xE6ttere p\xE5 Jorden, vil minus knappen bev\xE6ge kameraet l\xE6ngere bort.<\/div><\/div>');
  constants_da.put('mouseHelp', '<div class="helpControls"><h2>Muse-navigation<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Venstre knap<\/h3>Klik og tr\xE6k med venstre museknap for at flytte p\xE5 tv\xE6rs af kortet i en fast h\xF8jde. Brug SHIFT + venstre knap for at rotere.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>H\xF8jre knap<\/h3>H\xF8jreklik og tr\xE6k <b>op/ned<\/b> for at \xE6ndre Kameraets h\xF8jde. H\xF8jre click and tr\xE6k <b>venstre/h\xF8jre<\/b> for at rotere kameraets synsfelt.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Midterste knap/hjul<\/h3>Bug scroll hjulet for at \xE6ndre h\xF8jden af kameraet (samme som h\xF8jre click + tr\xE6k op/ned). Klik og tr\xE6k hjul knappen for at \xE6ndre kameraets vinkel.<\/div><\/div>');
