  constants_el.put('mapHelp', '<div class="helpControls"><h2>\u03A0\u03BB\u03BF\u03AE\u03B3\u03B7\u03C3\u03B7 \u03C3\u03C4\u03BF \u03C7\u03AC\u03C1\u03C4\u03B7<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Pan console<\/h3>The pan console allows you to move across the map at a fixed height. Click and drag to move continuously. The farther you drag from the center, the faster you will move.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>\u039A\u03BF\u03BD\u03C3\u03CC\u03BB\u03B1 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2<\/h3>\u0397 \u03BA\u03BF\u03BD\u03C3\u03CC\u03BB\u03B1 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2 \u03BC\u03B5\u03C4\u03B1\u03BA\u03B9\u03BD\u03B5\u03AF \u03BC\u03CC\u03BD\u03BF \u03C4\u03B7\u03BD \u03C0\u03C1\u03BF\u03B2\u03BF\u03BB\u03AE \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2. \u039A\u03AC\u03BD\u03C4\u03B5 \u03BA\u03BB\u03B9\u03BA \u03BA\u03B1\u03B9 \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 \u03B3\u03B9\u03B1 \u03BD\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03C4\u03B5 \u03C4\u03B7\u03BD \u03C0\u03C1\u03BF\u03B2\u03BF\u03BB\u03AE \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2. \u038C\u03C3\u03BF \u03C0\u03B9\u03BF \u03BC\u03B1\u03BA\u03C1\u03B9\u03AC \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 \u03B1\u03C0\u03CC \u03C4\u03BF \u03BA\u03AD\u03BD\u03C4\u03C1\u03BF, \u03C4\u03CC\u03C3\u03BF \u03C0\u03B9\u03BF \u03B3\u03C1\u03AE\u03B3\u03BF\u03C1\u03B1 \u03B8\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03C4\u03B5 \u03C4\u03B7\u03BD \u03C0\u03C1\u03BF\u03B2\u03BF\u03BB\u03AE.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>\u03A0\u03BB\u03AE\u03BA\u03C4\u03C1\u03B1 \u03B5\u03C3\u03C4\u03AF\u03B1\u03C3\u03B7\u03C2<\/h3>\u039A\u03AC\u03BD\u03BF\u03BD\u03C4\u03B1\u03C2 \u03BA\u03BB\u03B9\u03BA \u03C3\u03B5 \u03B1\u03C5\u03C4\u03AC \u03B8\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03B9 \u03C4\u03BF \u03CD\u03C8\u03BF\u03C2 \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2. \u03A4\u03BF \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF \u03C3\u03C5\u03BD \u03B8\u03B1 \u03BC\u03B5\u03C4\u03B1\u03BA\u03B9\u03BD\u03AE\u03C3\u03B5\u03B9 \u03C4\u03B7\u03BD \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\n\u03C0\u03B9\u03BF \u03BA\u03BF\u03BD\u03C4\u03AC \u03C3\u03C4\u03B7 \u03B3\u03B7, \u03C4\u03BF \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF \u03BC\u03B5\u03AF\u03BF\u03BD \u03B8\u03B1 \u03BC\u03B5\u03C4\u03B1\u03BA\u03B9\u03BD\u03AE\u03C3\u03B5\u03B9 \u03C4\u03B7\u03BD \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1 \u03C0\u03B9\u03BF \u03BC\u03B1\u03BA\u03C1\u03B9\u03AC.<\/div><\/div>');
  constants_el.put('mouseHelp', '<div class="helpControls"><h2>\u03A0\u03BB\u03BF\u03AE\u03B3\u03B7\u03C3\u03B7 \u03C0\u03BF\u03BD\u03C4\u03B9\u03BA\u03B9\u03BF\u03CD<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>\u0391\u03C1\u03B9\u03C3\u03C4\u03B5\u03C1\u03CC \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF<\/h3>\u039A\u03AC\u03BD\u03C4\u03B5 \u03BA\u03BB\u03B9\u03BA \u03BA\u03B1\u03B9 \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 \u03C7\u03C1\u03B7\u03C3\u03B9\u03BC\u03BF\u03C0\u03BF\u03B9\u03CE\u03BD\u03C4\u03B1\u03C2 \u03C4\u03BF \u03B1\u03C1\u03B9\u03C3\u03C4\u03B5\u03C1\u03CC \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF \u03C4\u03BF\u03C5 \u03C0\u03BF\u03BD\u03C4\u03B9\u03BA\u03B9\u03BF\u03CD \u03B3\u03B9\u03B1 \u03BD\u03B1 \u03BC\u03B5\u03C4\u03B1\u03BA\u03B9\u03BD\u03B7\u03B8\u03B5\u03AF\u03C4\u03B5 \u03C3\u03C4\u03BF \u03C7\u03AC\u03C1\u03C4\u03B7 \u03C3\u03B5 \u03C3\u03C4\u03B1\u03B8\u03B5\u03C1\u03CC \u03CD\u03C8\u03BF\u03C2. \u03A7\u03C1\u03B7\u03C3\u03B9\u03BC\u03BF\u03C0\u03BF\u03B9\u03AE\u03C3\u03C4\u03B5 \u03C4\u03BF \u03C3\u03C5\u03BD\u03B4\u03C5\u03B1\u03C3\u03BC\u03CC \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03C9\u03BD SHIFT + \u03B1\u03C1\u03B9\u03C3\u03C4\u03B5\u03C1\u03CC \u03BA\u03BB\u03B9\u03BA \u03B3\u03B9\u03B1 \u03C0\u03B5\u03C1\u03B9\u03C3\u03C4\u03C1\u03BF\u03C6\u03AE.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>\u0394\u03B5\u03BE\u03AF \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF<\/h3>\u039A\u03AC\u03BD\u03C4\u03B5 \u03B4\u03B5\u03BE\u03AF \u03BA\u03BB\u03B9\u03BA \u03BA\u03B1\u03B9 \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 \u03C0\u03C1\u03BF\u03C2 \u03C4\u03B1 <b>\u03C0\u03AC\u03BD\u03C9 / \u03BA\u03AC\u03C4\u03C9<\/b> \u03B3\u03B9\u03B1 \u03BD\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03C4\u03B5 \u03C4\u03BF \u03CD\u03C8\u03BF\u03C2 \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2. \u039A\u03AC\u03BD\u03C4\u03B5 \u03B4\u03B5\u03BE\u03AF \u03BA\u03BB\u03B9\u03BA \u03BA\u03B1\u03B9\n\u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 <b>\u03B1\u03C1\u03B9\u03C3\u03C4\u03B5\u03C1\u03AC / \u03B4\u03B5\u03BE\u03B9\u03AC<\/b> \u03B3\u03B9\u03B1 \u03C0\u03B5\u03C1\u03B9\u03C3\u03C4\u03C1\u03BF\u03C6\u03AE \u03C4\u03BF\u03C5 \u03BF\u03C0\u03C4\u03B9\u03BA\u03BF\u03CD \u03C0\u03B5\u03B4\u03AF\u03BF\u03C5 \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>\u039C\u03B5\u03C3\u03B1\u03AF\u03BF \u03C0\u03BB\u03AE\u03BA\u03C4\u03C1\u03BF / \u03C4\u03C1\u03BF\u03C7\u03CC\u03C2<\/h3>\u03A7\u03C1\u03B7\u03C3\u03B9\u03BC\u03BF\u03C0\u03BF\u03B9\u03AE\u03C3\u03C4\u03B5 \u03C4\u03BF\u03BD \u03C4\u03C1\u03BF\u03C7\u03CC \u03BA\u03CD\u03BB\u03B9\u03C3\u03B7\u03C2 \u03B3\u03B9\u03B1 \u03BD\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03C4\u03B5 \u03C4\u03BF \u03CD\u03C8\u03BF\u03C2 \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2 (\u03CC\u03C0\u03C9\u03C2 \u03C4\u03BF \u03B4\u03B5\u03BE\u03AF \u03BA\u03BB\u03B9\u03BA + \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5\n\u03C0\u03AC\u03BD\u03C9 \u03BA\u03AC\u03C4\u03C9). \u039A\u03AC\u03BD\u03C4\u03B5 \u03BA\u03BB\u03B9\u03BA \u03BA\u03B1\u03B9 \u03C3\u03CD\u03C1\u03B5\u03C4\u03B5 \u03C4\u03BF \u03BA\u03BF\u03C5\u03BC\u03C0\u03AF \u03C4\u03C1\u03BF\u03C7\u03BF\u03CD \u03B3\u03B9\u03B1 \u03BD\u03B1 \u03B1\u03BB\u03BB\u03AC\u03BE\u03B5\u03C4\u03B5 \u03C4\u03B7 \u03B3\u03C9\u03BD\u03AF\u03B1 \u03C4\u03B7\u03C2 \u03BA\u03AC\u03BC\u03B5\u03C1\u03B1\u03C2.<\/div><\/div>');
  constants_fi = new HashMap;
  this.entries.put('fi', constants_fi);
  constants_fi.put('keyboardHelp', '<div class="helpControls"><h2>K\xE4ytt\xF6 n\xE4pp\xE4imist\xF6ll\xE4<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Nuolin\xE4pp\xE4imet<\/h3>Liiku kartalla samalla korkeudella nuolin\xE4pp\xE4imill\xE4.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + nuolin\xE4pp\xE4imet<\/h3>Muuta kameran kuvakulmaa nuolin\xE4pp\xE4imill\xE4 ja pit\xE4m\xE4ll\xE4 SHIFT-n\xE4pp\xE4int\xE4 painettuna.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up-/Page down -n\xE4pp\xE4imet<\/h3>Muuta kameran korkeutta <b>PG UP<\/b>- ja <b>PG DN<\/b> -n\xE4pp\xE4imill\xE4.<\/div><\/div>');
  constants_fi.put('mapHelp', '<div class="helpControls"><h2>K\xE4ytt\xF6 kartan painikkeilla<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Py\xF6rityspainike<\/h3>Py\xF6rityspainikkeella voit py\xF6ritt\xE4\xE4 karttaa samalla korkeudella. Pid\xE4 painiketta painettuna, kun haluat ohjata py\xF6rimist\xE4 hiirell\xE4 jatkuvasti. Mit\xE4 kauemmas painikkeen keskikohdasta viet hiiren osoittimen, sit\xE4 nopeammin karttapallo py\xF6rii.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Kamerapainike<\/h3>Kamerapainike muuttaa vain kameran kuvakulmaa. Pid\xE4 painiketta painettuna ja ohjaa kuvakulmaa hiirell\xE4. Mit\xE4 kauemmas keskikohdasta viet hiiren, sit\xE4 nopeammin kuvakulma muuttuu.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>L\xE4hennys/loitonnus<\/h3>N\xE4ill\xE4 painikkeilla voit vaihtaa kameran korkeutta. Plusmerkki liikuttaa kameraa l\xE4hemm\xE4ksi maanpintaa ja miinusmerkki liikuttaa kameraa kauemmaksi.<\/div><\/div>');
  constants_fi.put('mouseHelp', '<div class="helpControls"><h2>K\xE4ytt\xF6 hiirell\xE4<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Vasen painike<\/h3>Pid\xE4 hiiren vasenta painiketta painettuna ja ved\xE4 karttaa, kun haluat liikkua kartalla samalla korkeudella. K\xE4\xE4nn\xE4 painamalla SHIFT + vasen painike.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Oikea painike<\/h3>Ved\xE4 <b>yl\xF6s/alas<\/b> oikealla painikkeella, kun haluat muuttaa kameran korkeutta. Paina oikeaa painiketta ja ved\xE4 <b>vasemmalle/oikealle<\/b>, kun haluat k\xE4\xE4nt\xE4\xE4 kameraa.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Keskipainike/rulla<\/h3>Muuta kameran korkeutta hiiren rullalla (tai paina hiiren oikeaa painiketta ja ved\xE4 yl\xF6s/alas). Pid\xE4 hiiren rullaa painettuna ja ved\xE4 haluamaasi suuntaan, kun haluat muuttaa kameran kulmaa.<\/div><\/div>');
  constants_de = new HashMap;
  this.entries.put('de', constants_de);
  constants_de.put('keyboardHelp', '<div class="helpControls"><h2>Tastaturnavigation<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Pfeiltasten<\/h3>Nutzen Sie die Pfeiltasten, um sich bei fixierter H\xF6he auf der Karte zu bewegen.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + Pfeiltasten<\/h3>Halten Sie SHIFT gedr\xFCckt und dr\xFCcken Sie die Pfeiltasten, um die Kameraperspektive zu \xE4ndern.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Bild auf/Bild ab<\/h3>Nutzen Sie  die Tasten "Bild auf" oder "Bild ab", um die H\xF6he der Kamera zu \xE4ndern.<\/div><\/div>');
  constants_de.put('mapHelp', '<div class="helpControls"><h2>Kartennavigation<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Schwenkkonsole<\/h3>Die Schwenkkonsole erlaubt Ihnen, sich bei fixierter H\xF6he \xFCber die Karte zu bewegen. Klicken und ziehen Sie, um sich gleichm\xE4\xDFig zu bewegen. Je weiter entfern Sie vom Mittelpunkt sind, desto schneller bewegen Sie sich.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Kamerakonsole<\/h3>Die Kamerakonsole bewegt nur die Kameraperspektive. Klicken und ziehen Sie, um die Kameraperspektive zu \xE4ndern. Je weiter Sie vom Mittelpunkt weg ziehen, desto schneller wird sich die Ansicht \xE4ndern.<br />Doppelklick mit der linken Maustaste auf die Kamerakonsole setzt die Kameraperspektive in eine genordete und Nadir Position zur\xFCck.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Zoom<\/h3>Durch Klicken wird die H\xF6he der Kamera ge\xE4ndert. Der Plusknopf bewegt die Kamera n\xE4her zur Erde, der Minusknopf bewegt die Kamera weiter weg von der Erde.<\/div><\/div>');
  constants_de.put('mouseHelp', '<div class="helpControls"><h2>Mausnavigation<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Linke Maustaste<\/h3>Klicken und ziehen Sie mit gedr\xFCckter linker Maustaste, um sich bei fixierter H\xF6he auf der Karte zu bewegen. Benutzten Sie SHIFT + linke Maustaste zum Drehen.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Rechte Maustaste<\/h3>Rechtsklick und <b>hoch/runter<\/b> ziehen, um die H\xF6he der Kamera zu \xE4ndern. Rechtsklick und nach <b>links/rechts<\/b> ziehen, um die Kameraperspektive zu drehen.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Mittlere Maustaste/Maus\xADrad<\/h3>Nutzen Sie das Mausrad, um die H\xF6he der Kamera zu \xE4ndern (Rechtsklick + runter/hoch ziehen). Klicken und ziehen Sie mit dem Mausrad, um den Winkel der Kamera zu \xE4ndern.<\/div><\/div>');
  constants_es = new HashMap;
  this.entries.put('es', constants_es);
  constants_es.put('keyboardHelp', '<div class="helpControls"><h2>Navegaci\xF3n mediante teclado<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Teclas de flechas<\/h3>Use las teclas de flechas para moverse por el mapa a una altitud determinada.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>MAY\xDAS + teclas de flechas<\/h3>Para cambiar la vista de la c\xE1mara pulse las flechas mientras mantiene pulsada la tecla MAY\xDAS.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>ReP\xE1g/AvP\xE1g<\/h3>Use las teclas ReP\xE1g y AvP\xE1g para cambiar la altura de la c\xE1mara.<\/div><\/div>');
  constants_es.put('mapHelp', '<div class="helpControls"><h2>Navegaci\xF3n mediante mapa<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Consola de panorama<\/h3>La consola de panorama permite moverse sobre el mapa a una altitud determinada. Al pulsar y arrastrar se produce un desplazamiento continuo que ser\xE1 m\xE1s veloz cuanto m\xE1s se aleje del centro al arrastrar.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Consola de la c\xE1mara<\/h3>La consola de la c\xE1mara solo modifica lo que la c\xE1mara ve. Pulse y arrastre para cambiar la vista de la c\xE1mara. La vista cambia con m\xE1s velocidad cuanto m\xE1s se aleje del centro al arrastrar.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Botones de acercamiento y alejamiento<\/h3>Al pulsar cambia la altura de la c\xE1mara. El bot\xF3n "+" acerca la c\xE1mara al suelo, mientras que el bot\xF3n "-" la aleja.<\/div><\/div>');
  constants_es.put('mouseHelp', '<div class="helpControls"><h2>Mouse navigation<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Bot\xF3n izquierdo<\/h3>Pulse con el bot\xF3n izquierdo del rat\xF3n y arrastre para desplazarse por el mapa a una altitud fija. Use MAY\xDAS + bot\xF3n izquierdo para rotar.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Bot\xF3n derecho<\/h3>Pulse el bot\xF3n derecho del rat\xF3n y arrastre hacia arriba o hacia abajo para cambiar la altura de la c\xE1mara. Pulse el bot\xF3n derecho del rat\xF3n y arrastre hacia la izquierda o la derecha para rotar la vista de la c\xE1mara.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Bot\xF3n central o rueda<\/h3>Use la rueda del rat\xF3n para cambiar la altura de la c\xE1mara (se obtiene el mismo efecto pulsando el bot\xF3n derecho y arrastrando hacia arriba o hacia abajo). Pulse con el bot\xF3n de la rueda y arrastre para cambiar el \xE1ngulo de la c\xE1mara.<\/div><\/div>');
  constants_fr = new HashMap;
  this.entries.put('fr', constants_fr);
  constants_fr.put('keyboardHelp', '<div class="helpControls"><h2>Navigation clavier<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Fl\xE8ches du clavier<\/h3>Utilisez les touches fl\xE9ch\xE9es pour vous d\xE9placer sur la carte \xE0 une hauteur fixe.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + touches fl\xE9ch\xE9es<\/h3>Maintenez la touche SHIFT tout en appuyant sur les touches fl\xE9ch\xE9es pour changer la vue de la cam\xE9ra.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page pr\xE9c\xE9dente/Page suivante<\/h3>Utilisez les touches <b>PG UP ou PG DN<\/b> pour modifier l\'\xE9l\xE9vation de la cam\xE9ra.<\/div><\/div>');
  constants_fr.put('mapHelp', '<div class="helpControls"><h2>Navigation par carte<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Console panoramique<\/h3>La console panoramique vous permet de vous d\xE9placer sur la carte \xE0 une hauteur fixe. Cliquez et faites glisser pour vous d\xE9placer en continu. Plus vous vous \xE9loignez du centre, plus vous vous d\xE9placez rapidement.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Console de cam\xE9ra<\/h3>La console de la cam\xE9ra d\xE9place uniquement la vue de la cam\xE9ra. Cliquez et faites glisser pour modifier la vue de la cam\xE9ra. Plus vous vous \xE9loignez du centre, plus vous changez de vue rapidement. Plus vous vous \xE9loignez du centre, plus vite vous modifiez la vue.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Boutons de zoom<\/h3>En cliquant dessus, vous modifiez l\'\xE9l\xE9vation de la cam\xE9ra. Le bouton plus rapprochera la cam\xE9ra plus pr\xE8s de la terre, le bouton moins \xE9loigne la cam\xE9ra.<\/div><\/div>');
  constants_fr.put('mouseHelp', '<div class="helpControls"><h2>Navigation avec la souris<\/h2><div><img src="$URL{mLeft}" class="rightImg" /><h3>Bouton gauche<\/h3>Faites glisser la souris avec le bouton gauche de la souris enfonc\xE9 afin de vous d\xE9placer sur la carte avec une hauteur fixe. Utilisez SHIFT + le bouton gauche afin de pivoter.<\/div><div><img src="$URL{mRight}" class="rightImg" /><h3>Bouton droit<\/h3>Cliquez avec le bouton droit de la souris et faites glisser vers le <b>haut/bas<\/b> pour modifier l\'\xE9l\xE9vation de la cam\xE9ra. Cliquez avec le bouton droit de la souris et glisser vers la <b>gauche/droite<\/b> pour faire pivoter la vue de la cam\xE9ra.<\/div><div><img src="$URL{mCenter}" class="rightImg" /><h3>Bouton central/roulette<\/h3>Utilisez la molette de d\xE9filement pour modifier l\'\xE9l\xE9vation de la cam\xE9ra (de la m\xEAme mani\xE8re que le clic droit + glisser haut/bas). Cliquez et faites glisser le bouton de la roue pour modifier l\'angle de la cam\xE9ra.<\/div><\/div>');
  constants_lv = new HashMap;
  this.entries.put('lv', constants_lv);
  constants_lv.put('keyboardHelp', '<div class="helpControls"><h2>Tastat\u016Bras navig\u0101cija<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Bultu tausti\u0146i<\/h3>Izmantojiet bultu tausti\u0146us, lai p\u0101rvietotos fiks\u0113t\u0101 augstum\u0101 virs kartes.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + bultu tausti\u0146i<\/h3>Turiet SHIFT tausti\u0146u un spiediet bulttausti\u0146us, lai main\u012Btu kameras skatu.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up/Page down<\/h3>Izmantojiet <b>PG UP un PG DN<\/b> tausti\u0146us lai main\u012Btu kameras augstumu.<\/div><\/div>');
  constants_lv.put('mapHelp', '<div class="helpControls"><h2>Kartes navig\u0101cija<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>B\u012Bd\u012B\u0161anas konsole \u013Cauj p\u0101rvietoties nemain\u012Bg\u0101 augstum\u0101. Klik\u0161\u0137iniet uz velciet peli, lai p\u0101rvietotos. Att\u0101linoties no centra palielin\u0101sies p\u0101rvieto\u0161an\u0101s \u0101trums.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Kameras konsole kustina tikai kameras skatu. Klik\u0161\u0137iniet un velciet, lai main\u012Btu kameras skatu. Virz\u012B\u0161an\u0101s prom no centra p\u0101atrina izmai\u0146as.<br />Dubultklik\u0161\u0137is ar kreiso peles tausti\u0146u atgrie\u017E kameras skatu lejupv\u0113rst\u0101 virzien\u0101 uz Zieme\u013Ciem.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>T\u0101lummai\u0146as pogas<\/h3>Klik\u0161\u0137inot tos tiks main\u012Bts kameras augstums. + tausti\u0146\u0161 kustin\u0101s kameru tuv\u0101k zemes virsmai, bet - tausti\u0146\u0161 kameru att\u0101lin\u0101s.<\/div><\/div>');
  constants_lv.put('mouseHelp', '<div class="helpControls"><h2>Peles navig\u0101cija<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Kreisais tausti\u0146\u0161<\/h3>Klik\u0161\u0137iniet kreiso peles tausti\u0146u un velciet, lai p\u0101rvietotos nemain\u012Bg\u0101 augstum\u0101.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Labais tausti\u0146\u0161<\/h3>Klik\u0161\u0146iet labo peles tausti\u0146u un velciet uz aug\u0161u, un leju, lai main\u012Btu kameras augstumu. Klik\u0161\u0137iniet labo peles tausti\u0146u un velciet pa labu, un pa kreisi, lai rot\u0113tu kameras skatu.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Vid\u0113jais tausti\u0146\u0161/riten\u012Btis<\/h3>Izmantojiet peles riten\u012Bti, lai main\u012Btu kameras augstumu (t\u0101pat k\u0101 labais klik\u0161\u0137is + vilk\u0161ana aug\u0161\u0101/lej\u0101).  ');
  constants_ro = new HashMap;
  this.entries.put('ro', constants_ro);
  constants_ro.put('keyboardHelp', '<div class="helpControls"><h2>Navigarea cu ajutorul tastaturii<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Taste s\u0103ge\u021Bi<\/h3>Utiliza\u021Bi tastele s\u0103ge\u021Bi pentru a se deplasa pe hart\u0103 la o \xEEn\u0103l\u021Bime fix\u0103.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + tastele s\u0103ge\u021Bi<\/h3>Men\u021Bine\u021Bi ap\u0103sat\u0103 tasta SHIFT la ap\u0103sarea tastelor s\u0103ge\u021Bi pentru a schimba vederea camerei.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up/Page down<\/h3>Utiliza\u021Bi butoanele <b>PG UP sau PG DN<\/b> pentru a schimba \xEEn\u0103l\u021Bimea camerei.<\/div><\/div>');
  constants_ro.put('mapHelp', '<div class="helpControls"><h2>Navigarea pe hart\u0103<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Consol\u0103 de panoramare<\/h3>Consola de panoramare v\u0103 permite deplasarea pe hart\u0103 la o \xEEn\u0103l\u021Bime fix\u0103. Face\u021Bi clic \u0219i glisa\u021Bi pentru a v\u0103 deplasa continuu. Cu c\xEEt mai departe de centru glisa\u021Bi, cu at\xEEt mai repede v\u0103 ve\u021Bi deplasa.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3> Consola camerei<\/h3>Consola camerei deplaseaz\u0103 doar vederea camerei. Face\u021Bi clic \u0219i glisa\u021Bi pentru a schimba vederea camerei. Cu c\xEEt mai departe de centru glisa\u021Bi, cu at\xEEt mai repede ve\u021Bi schimba vederea.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Butoane de panoramare<\/h3>F\u0103c\xEEnd clic pe acestea se va schimba \xEEn\u0103l\u021Bimea camerei. Butonul plus va deplasa camera mai aproape de p\u0103m\xEEnt, butonul minus va \xEEndep\u0103rta camera.<\/div><\/div>');
  constants_ro.put('mouseHelp', '<div class="helpControls"><h2>Navigarea cu ajutorul mouse-ului<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Buton st\xEEnga<\/h3>Face\u021Bi clic \u0219i glisa\u021Bi folosind butonul st\xEEnga al mouse-ului pentru a se deplasa pe hart\u0103 la o \xEEn\u0103l\u021Bime fix\u0103.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Buton dreapta<\/h3>Clic dreapta \u0219i glisa\u021Bi <b>up/down<\/b> pentru a schimba \xEEn\u0103l\u021Bimea camerei. Clic dreapta \u0219i glisa\u021Bi <b>left/right<\/b> pentru a roti vederea camerei.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Butonul din mijloc/roti\u0163a<\/h3>Derula\u0163i roti\u0163a pentru a schimba \xEEn\u0103l\u021Bimea camerei (asemenea clic dreapta + glisa\u021Bi \xEEn sus / jos). Clic dreapta \u0219i glisa\u021Bi butonul roti\u021Bei pentru a schimba unghiul camerei.<\/div><\/div>');
  constants_sr = new HashMap;
  this.entries.put('sr', constants_sr);
  constants_sr.put('keyboardHelp', '<div class="helpControls"><h2>\u041D\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u0458\u0430 \u0442\u0438\u043F\u043A\u043E\u0432\u043D\u0438\u0446\u043E\u043C<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>\u0421\u0442\u0440\u0435\u043B\u0438\u0446\u0435<\/h3>\u0421\u0442\u0440\u0435\u043B\u0438\u0446\u0435 \u0441\u0435 \u043A\u043E\u0440\u0438\u0441\u0442\u0435 \u0437\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u043A\u0430\u043C\u0435\u0440\u0435 \u043F\u043E \u0445\u043E\u0440\u0438\u0437\u043E\u043D\u0442\u0430\u043B\u043D\u043E\u0458 \u0440\u0430\u0432\u043D\u0438.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + \u0441\u0442\u0440\u0435\u043B\u0438\u0446\u0435<\/h3>\u0421\u0442\u0440\u0435\u043B\u0438\u0446\u0435 \u0443\u0437 \u043F\u0440\u0438\u0442\u0438\u0441\u043D\u0443\u0442\u0443 \u0434\u0438\u0440\u043A\u0443 SHIFT \u043A\u043E\u0440\u0438\u0441\u0442\u0435 \u0441\u0435 \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u043A\u0430\u043C\u0435\u0440\u0435.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>\u0421\u0442\u0440\u0430\u043D\u0430 \u0433\u043E\u0440\u0435/\u0421\u0442\u0440\u0430\u043D\u0430 \u0434\u043E\u043B\u0435<\/h3>\u0414\u0438\u0440\u043A\u0435 <b>PG UP \u0438 PG DN<\/b> \u043A\u043E\u0440\u0438\u0441\u0442\u0435 \u0441\u0435 \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u0432\u0438\u0441\u0438\u043D\u0435 \u043A\u0430\u043C\u0435\u0440\u0435 (\u0458\u0435\u0434\u043D\u0430\u043A\u043E \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u0458\u0438 \u0434\u0435\u0441\u043D\u043E \u0434\u0443\u0433\u043C\u0435 \u043D\u0430 \u043C\u0438\u0448\u0443 \u0438 \u045A\u0435\u0433\u043E\u0432\u043E \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u0443 \u043F\u0440\u0430\u0432\u0446\u0443 \u0433\u043E\u0440\u0435/\u0434\u043E\u043B\u0435).<\/div><\/div>');
  constants_sr.put('mapHelp', '<div class="helpControls"><h2>\u041D\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u0458\u0430 \u043C\u0430\u043F\u043E\u043C<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>\u041A\u043E\u043D\u0437\u043E\u043B\u0430 \u0437\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435<\/h3>\u041F\u0440\u0432\u0430 \u043A\u043E\u043D\u0437\u043E\u043B\u0430 \u043E\u043C\u043E\u0433\u0443\u045B\u0430\u0432\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u043A\u0430\u043C\u0435\u0440\u0435 \u043F\u043E \u0445\u043E\u0440\u0438\u0437\u043E\u043D\u0442\u0430\u043B\u043D\u043E\u0458 \u0440\u0430\u0432\u043D\u0438. \u0417\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u043A\u043B\u0438\u043A\u043D\u0438\u0442\u0435 \u0438 \u043F\u0440\u0435\u0432\u0443\u0446\u0438\u0442\u0435 \u043C\u0438\u0448. \u0411\u0440\u0437\u0438\u043D\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0430 \u043A\u0430\u043C\u0435\u0440\u0435 \u0443\u0432\u0435\u045B\u0435\u0432\u0430 \u0441\u0430 \u0443\u0434\u0430\u0459\u0435\u043D\u043E\u0448\u045B\u0443 \u043E\u0434 \u0441\u0440\u0435\u0434\u0438\u0448\u0442\u0430 \u043A\u043E\u043D\u0437\u043E\u043B\u0435.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>\u041A\u043E\u043D\u0437\u043E\u043B\u0430 \u0437\u0430 \u043A\u0430\u043C\u0435\u0440\u0443<\/h3>\u0414\u0440\u0443\u0433\u0430 \u043A\u043E\u043D\u0437\u043E\u043B\u0430 \u043E\u043C\u043E\u0433\u0443\u045B\u0430\u0432\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u043A\u0430\u043C\u0435\u0440\u0435. \u0417\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u043A\u043B\u0438\u043A\u043D\u0438\u0442\u0435 \u0438 \u043F\u0440\u0435\u0432\u0443\u0446\u0438\u0442\u0435 \u043C\u0438\u0448. \u0411\u0440\u0437\u0438\u043D\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0435 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u0443\u0432\u0435\u045B\u0435\u0432\u0430 \u0441\u0430 \u0443\u0434\u0430\u0459\u0435\u043D\u043E\u0448\u045B\u0443 \u043E\u0434 \u0441\u0440\u0435\u0434\u0438\u0448\u0442\u0430 \u043A\u043E\u043D\u0437\u043E\u043B\u0435.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>\u0414\u0443\u0433\u043C\u0430\u0434 \u0437\u0430 \u0437\u0443\u043C\u0438\u0440\u0430\u045A\u0435<\/h3>\u0414\u0443\u0433\u043C\u0430\u0434 \u0441\u0435 \u043A\u043E\u0440\u0438\u0441\u0442\u0438 \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u0432\u0438\u0441\u0438\u043D\u0435 \u043A\u0430\u043C\u0435\u0440\u0435. \u0414\u0443\u0433\u043C\u0435 \u043F\u043B\u0443\u0441 \u043F\u043E\u043C\u0435\u0440\u0430 \u043A\u0430\u043C\u0435\u0440\u0443 \u0431\u043B\u0438\u0436\u0435 \u043F\u043E\u0432\u0440\u0448\u0438\u043D\u0438, \u0434\u043E\u043A \u0434\u0443\u0433\u043C\u0435 \u043C\u0438\u043D\u0443\u0441 \u043A\u0430\u043C\u0435\u0440\u0443 \u043F\u043E\u043C\u0435\u0440\u0430 \u043E\u0434 \u043F\u043E\u0432\u0440\u0448\u0438\u043D\u0435.<\/div><\/div>');
  constants_sr.put('mouseHelp', '<div class="helpControls"><h2>\u041D\u0430\u0432\u0438\u0433\u0430\u0446\u0438\u0458\u0430 \u043C\u0438\u0448\u0435\u043C<\/h2><div><img src="$URL{mLeft}" class="rightImg" /><h3>\u041B\u0435\u0432\u043E \u0434\u0443\u0433\u043C\u0435<\/h3>\u041A\u043B\u0438\u043D\u0438\u0442\u0435 \u043B\u0435\u0432\u043E \u0434\u0443\u0433\u043C\u0435 \u043D\u0430 \u043C\u0438\u0448\u0443 \u0438 \u043F\u0440\u0435\u0432\u0443\u0446\u0438\u0442\u0435 \u0433\u0430 \u0437\u0430 \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u043F\u043E \u0445\u043E\u0440\u0438\u0437\u043E\u043D\u0442\u0430\u043B\u043D\u043E\u0458 \u0440\u0430\u0432\u043D\u0438.<\/div><div><img src="$URL{mRight}" class="rightImg" /><h3>\u0414\u0435\u0441\u043D\u043E \u0434\u0443\u0433\u043C\u0435<\/h3>\u041A\u043B\u0438\u043A\u043D\u0438\u0442\u0435 \u0434\u0435\u0441\u043D\u043E \u0434\u0443\u0433\u043C\u0435 \u043D\u0430 \u043C\u0438\u0448\u0443 \u0438 \u043F\u0440\u0435\u0432\u0443\u0446\u0438\u0442\u0435 \u0433\u0430 \u0443 \u043F\u0440\u0430\u0432\u0446\u0443 <b>\u0433\u043E\u0440\u0435/\u0434\u043E\u043B\u0435<\/b> \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u0432\u0438\u0441\u0438\u043D\u0435 \u043A\u0430\u043C\u0435\u0440\u0435 \u043E\u0434\u043D\u043E\u0441\u043D\u043E \u0443 \u043F\u0440\u0430\u0432\u0446\u0443 <b>\u043B\u0435\u0432\u043E/\u0434\u0435\u0441\u043D\u043E<\/b> \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u043A\u0430\u043C\u0435\u0440\u0435.<\/div><div><img src="$URL{mCenter}" class="rightImg" /><h3>\u0421\u0440\u0435\u0434\u045A\u0435 \u0434\u0443\u0433\u043C\u0435/\u043A\u043E\u0442\u0430\u0447\u0438\u045B<\/h3>\u0417\u0430\u043A\u043E\u0442\u0440\u0459\u0430\u0458\u0442\u0435 \u043A\u043E\u0442\u0430\u0447\u0438\u045B \u0437\u0430 \u043F\u0440\u043E\u043C\u0435\u043D\u0443 \u0432\u0438\u0441\u0438\u043D\u0435 \u043A\u0430\u043C\u0435\u0440\u0435 (\u0458\u0435\u0434\u043D\u0430\u043A\u043E \u043A\u043E\u043C\u0431\u0438\u043D\u0430\u0446\u0438\u0458\u0438 \u0434\u0435\u0441\u043D\u043E \u0434\u0443\u0433\u043C\u0435 \u043D\u0430 \u043C\u0438\u0448\u0443 \u0438 \u045A\u0435\u0433\u043E\u0432\u043E \u043F\u043E\u043C\u0435\u0440\u0430\u045A\u0435 \u0443 \u043F\u0440\u0430\u0432\u0446\u0443 \u0433\u043E\u0440\u0435/\u0434\u043E\u043B\u0435). \u041A\u043B\u0438\u043A\u043D\u0438\u0442\u0435 \u0441\u0440\u0435\u0434\u045A\u0435 \u0434\u0443\u0433\u043C\u0435 \u0438 \u043F\u0440\u0435\u0432\u0443\u0446\u0438\u0442\u0435 \u043C\u0438\u0448 \u0437\u0430 \u0440\u043E\u0442\u0438\u0440\u0430\u045A\u0435 \u043F\u043E\u0433\u043B\u0435\u0434\u0430 \u043A\u0430\u043C\u0435\u0440\u0435.<\/div><\/div>');
  constants_sv = new HashMap;
  this.entries.put('sv', constants_sv);
  constants_sv.put('keyboardHelp', '<div class="helpControls"><h2>Navigera med tangentbordet<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Pilknappar<\/h3>Anv\xE4nd pilknapparna f\xF6r att f\xF6rflytta dig p\xE5 kartan p\xE5 en fast h\xF6jd.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + pilknappar<\/h3>H\xE5ll in SHIFT-knappen samtidigt som du trycket p\xE5 pilknapparna f\xF6r att \xE4ndra kameravyn.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up/Page down<\/h3>Anv\xE4nd knapparna <b>PG UP eller PG DN<\/b> f\xF6r att \xE4ndra kamerans h\xF6jdl\xE4ge.<\/div><\/div>');
  constants_sv.put('mapHelp', '<div class="helpControls"><h2>Navigera p\xE5 kartan<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Panoreringskonsol<\/h3>Panoreringskonsolen l\xE5ter dig f\xF6rflytta dig p\xE5 kartan p\xE5 en fast h\xF6jd. Klicka och dra f\xF6r att f\xF6rflytta dig I en kontinuerlig r\xF6relse. Ju l\xE4ngre du drar fr\xE5n mitten, desto snabbare kommer du att r\xF6ra dig.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Kamerakonsol<\/h3>Kamerakonsolen flyttar endast kameravyn. Klicka och dra f\xF6r att \xE4ndra kameravyn. Ju l\xE4ngre du drar fr\xE5n mitten, desto snabbare \xE4ndras vyn.<br />N\xE4r du dubbelklickar med v\xE4nstra musknappen p\xE5 kamerakonsolen \xE5terst\xE4lls kameravyn till norr och ned\xE5triktat l\xE4ge.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Zoom-knappar<\/h3>Klicka p\xE5 knapparna f\xF6r att \xE4ndra kamerans h\xF6jdl\xE4ge. Plusknappen kommer att flytta kameran n\xE4rmare jorden och minusknappen flyttar kameran l\xE4ngre bort.<\/div><\/div>');
  constants_sv.put('mouseHelp', '<div class="helpControls"><h2>Navigera med musen<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>V\xE4nster knapp<\/h3>Klicka och dra med v\xE4nstra musknappen f\xF6r att f\xF6rflytta dig p\xE5 kartan p\xE5 en fast h\xF6jd. Rotera med SHIFT + v\xE4nster knapp.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>H\xF6ger knapp<\/h3>H\xF6gerklicka och dra <b>upp\xE5t/ned\xE5t<\/b> f\xF6r att \xE4ndra kamerans h\xF6jdl\xE4ge. H\xF6gerklicka och dra till <b>v\xE4nster/h\xF6ger<\/b> f\xF6r att rotera kameravyn.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>Mittknapp/hjul<\/h3>Anv\xE4nd mushjulet f\xF6r att \xE4ndra kamerans h\xF6jdl\xE4ge (samma som h\xF6gerklick + dra upp\xE5t/ned\xE5t). Klicka och dra mushjulet f\xF6r att \xE4ndra kamerans vinkel.<\/div><\/div>');
  constants_sl = new HashMap;
  this.entries.put('sl', constants_sl);
  constants_sl.put('keyboardHelp', '<div class="helpControls"><h2>Navigacija tipkovnice<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Smerne tipke<\/h3>Uporabite smerne tipke za premikanje po horizontalni osi zemljevida.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + smerne tipke<\/h3>Dr\u017Eite tipko SHIFT in uporabite smerne tipke za spreminjanje pogleda kamere.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up/Page down<\/h3>Uporabite tipki <b>PG UP in PG DN<\/b> da spremenite vi\u0161ino kamere (enako kot desni klik + gor ali dol).<\/div><\/div>');
  constants_sl.put('mapHelp', '<div class="helpControls"><h2>Navigacija na zemljevidu<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Konzola za premikanje<\/h3>Prva konzola omogo\u010Da premikanje. Pritisnite ter vlecite po konzoli za nemoteno premikanje po zemljevidu. Dlje kot boste \u0161li od sredi\u0161\u010Da konzole, hitreje se boste premikali.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Konzola za kamero<\/h3>Druga konzola omogo\u010Da spreminjanje pogleda kamere. Pritisnite in vlecite za nemoteno premikanje pogleda. Dlje kot boste \u0161li od sredi\u0161\u010Da konzole, hitreje boste spreminjali pogled.<br />Dvoklik z levim gumbom mi\u0161ke na konzoli za kamero ponastavi pogled kamere, tako da gleda proti severu in navzdol.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Gumbi za pribli\u017Eavo<\/h3>Spremenite vi\u0161ino pogleda kamere. Plus gumb premika kamero proti zemlji, minus gumb pa premika pogled vi\u0161je.<\/div><\/div>');
  constants_sl.put('mouseHelp', '<div class="helpControls"><h2>Navigacija z mi\u0161ko<\/h2><div><img src="$URL{mLeft}" class="rightImg" /><h3>Levi gumb<\/h3>Kliknite levi gumb in povlecite za premikanje po horizontalni osi zemljevida. Uporabite SHIFT + levi gumb za rotacijo.<\/div><\/div><div><img src="$URL{mRight}" class="rightImg" /><h3>Desni gumb<\/h3>Kliknite desni gumb in povlecite <b>gor ali dol<\/b> za spremembo vi\u0161ine kamere oz. <b>levo ali desno<\/b> za zasuk kamere.<\/div><div><img src="$URL{mCenter}" class="rightImg" /><h3>Srednji gumb/kole\u0161\u010Dek<\/h3>Zavrtite mi\u0161kin kole\u0161\u010Dek, da spremenite vi\u0161ino kamere (enako kot desni klik + gor ali dol). Kliknite srednji gumb in povlecite, da zavrtite pogled kamere.<\/div><\/div>');
  constants_pl = new HashMap;
  this.entries.put('pl', constants_pl);
  constants_pl.put('keyboardHelp', '<div class="helpControls"><h2>Nawigacja klawiatur\u0105<\/h2><div><img src="$URL{arrows}" class="rightImg"/><h3>Przyciski strza\u0142ek<\/h3>U\u017Cyj przycisk\xF3w strza\u0142ek, \u017Ceby porusza\u0107 si\u0119 po mapie na ustalonej wysoko\u015Bci.<\/div><div><img src="$URL{shift}" class="rightImg"/><h3>SHIFT + przyciski strza\u0142ek<\/h3>Przytrzymaj klawisz SHIFT, naciskaj\u0105c jednocze\u015Bnie klawisze strza\u0142ek, aby zmieni\u0107 widok z kamery.<\/div><div><img src="$URL{pgUp}" class="rightImg"/><h3>Page up/Page down<\/h3>U\u017Cyj przycisk\xF3w <b>PG UP<\/b> lub <b>PG DN<\/b>, aby zmieni\u0107 wysoko\u015B\u0107 po\u0142o\u017Cenia kamery.<\/div><\/div>');
  constants_pl.put('mapHelp', '<div class="helpControls"><h2>Nawigacja map\u0105<\/h2><div><img src="$URL{panS}" class="rightImg"/><h3>Konsola przesuwania<\/h3>Konsola przesuwania umo\u017Cliwia przemieszczanie si\u0119 po mapie na sta\u0142ej wysoko\u015Bci. Kliknij i przeci\u0105gnij, aby porusza\u0107 si\u0119 w spos\xF3b ci\u0105g\u0142y. Im dalej przeci\u0105gniesz od \u015Brodka, tym szybciej b\u0119dziesz si\u0119 porusza\u0107.<\/div><div><img src="$URL{rotateS}" class="rightImg"/><h3>Konsola kamery<\/h3>Konsola kamery przesuwa tylko widok kamery. Kliknij i przeci\u0105gnij, aby zmieni\u0107 widok kamery. Im dalej przeci\u0105gasz od \u015Brodka, tym szybciej zmieniasz widok.<br />Dwukrotne klikni\u0119cie lewym przyciskiem myszy na konsoli kamery powoduje przywr\xF3cenie widoku z kamery do pozycji patrz\u0105cej na p\xF3\u0142noc i w d\xF3\u0142.<\/div><div><img src="$URL{zoomS}" class="rightImg"/><h3>Przyciski przybli\u017Cenia/oddalenia<\/h3>Klikni\u0119cie ich spowoduje zmian\u0119 wysoko\u015Bci kamery. Przycisk plus przesunie kamer\u0119 bli\u017Cej Ziemi, a przycisk minus - dalej.<\/div><\/div>');
  constants_pl.put('mouseHelp', '<div class="helpControls"><h2>Nawigacja mysz\u0105<\/h2><div><img src="$URL{mLeft}" class="rightImg"/><h3>Lewy przycisk<\/h3>Kliknij i przeci\u0105gnij, u\u017Cywaj\u0105c lewego przycisku myszy, aby porusza\u0107 si\u0119 po mapie na sta\u0142ej wysoko\u015Bci.<\/div><div><img src="$URL{mRight}" class="rightImg"/><h3>Prawy przycisk<\/h3>Kliknij prawym przyciskiem myszy i przeci\u0105gnij w g\xF3r\u0119/d\xF3\u0142, aby zmieni\u0107 wysoko\u015B\u0107 kamery. Kliknij prawym przyciskiem myszy i przeci\u0105gnij w lewo/prawo, aby obr\xF3ci\u0107 widok z kamery.<\/div><div><img src="$URL{mCenter}" class="rightImg"/><h3>\u015Arodkowy przycisk/scroll<\/h3>U\u017Cyj k\xF3\u0142ka przewijania, aby zmieni\u0107 wysoko\u015B\u0107 kamery (tak samo jak klikni\u0119cie prawym przyciskiem myszy + przeci\u0105ganie g\xF3ra/d\xF3\u0142). Kliknij i przeci\u0105gnij przycisk k\xF3\u0142ka, aby zmieni\u0107 k\u0105t kamery.<\/div><\/div>');
